Барселона от Sports.ru для iOS – новое приложение о футбольном клубе FC Barcelona, выступающем в Испанской Ла Лиге (Примере), позволяет любителям футбола всегда быть в курсе происходящего в любимой команде. 

Приложение о ФК Барселоне включает: 

• Новости, анонсы, тексты лучших спортивных журналистов и интервью о ФК Барселоне; 
• Онлайн трансляции матчей и состав команды; 
• Командную статистику во всех турнирах в режиме реального времени; 
• Календари всех турниров и турнирные таблицы; 
• Блоги и материалы пользователей о FC Barcelona; 
• Фото и видео; 
• Форумы и чаты для общения с другими болельщиками. 
• Освещение всего сезона, включая испанский футбол - Ла Лига и Кубок Короля, а также еврокубки – Лигу Чемпионов (ЛЧ) и Лигу Европы (ЛЕ).
